import Footer from '../../component/footer/Footer';
import DontMissList from '../../component/mainComp/DontMiss/DontMissList';
import MainNews from '../../component/mainComp/mainNews/MainNews';
import './home.scss';
import { HomeContext } from '../../Context/HomeContext';
import { useContext,useState } from 'react';
const commonProps={
    theme:'dark',
    user:"mans"
}

const Home = () => {
    const [Props,setProps] = useState(commonProps);
    return ( 
        <HomeContext.Provider value={{Props,setProps}}>
            <div className="home">
                <div className="pageContainer">
                    <MainNews/>
                    <DontMissList/>
                </div>
                <Footer/>
            </div>
        </HomeContext.Provider>
    
     );
}
 
export default Home;
